import React from 'react';

// Mock chart components - recharts y√ºklenmemi≈üken kullanƒ±lƒ±r
export const ResponsiveContainer = ({ children, width, height }) => (
  <div style={{ width, height }} className="flex items-center justify-center bg-gray-50 dark:bg-gray-700 rounded-lg">
    <div className="text-center">
      <div className="text-4xl mb-2">üìä</div>
      <p className="text-sm text-gray-500 dark:text-gray-400">Chart Component</p>
      <p className="text-xs text-gray-400">Install recharts package to see charts</p>
    </div>
  </div>
);

export const LineChart = ({ children, data }) => (
  <div className="w-full h-full flex items-center justify-center">
    <div className="text-center">
      <div className="text-2xl mb-2">üìà</div>
      <p className="text-xs text-gray-500">Line Chart ({data?.length || 0} points)</p>
    </div>
  </div>
);

export const BarChart = ({ children, data }) => (
  <div className="w-full h-full flex items-center justify-center">
    <div className="text-center">
      <div className="text-2xl mb-2">üìä</div>
      <p className="text-xs text-gray-500">Bar Chart ({data?.length || 0} bars)</p>
    </div>
  </div>
);

export const PieChart = ({ children }) => (
  <div className="w-full h-full flex items-center justify-center">
    <div className="text-center">
      <div className="text-2xl mb-2">üç∞</div>
      <p className="text-xs text-gray-500">Pie Chart</p>
    </div>
  </div>
);

export const XAxis = ({ dataKey }) => null;
export const YAxis = () => null;
export const CartesianGrid = () => null;
export const Tooltip = () => null;
export const Line = () => null;
export const Bar = () => null;
export const Pie = () => null;
export const Cell = () => null;
